import React, { useState } from "react";
const New = () => {
  //   const [dress, setDress] = useState({
  //     materials: "",
  //     color: "",
  //     size: "",
  //   });

  const [materials, setMaterials] = useState([
    {
        label: "Cotton",
        value: "cotton",
      },
      {
        label: "Leather",
        value: "leather",
      },
      {
        label: "Banana",
        value: "banana",
      },
      {
        label: "Pineapple",
        value: "pineapple",
      },
  ]);
  const [color, setColor] = useState([
    {
      label: "Red",
      value: "red",
    },
    {
      label: "Blue",
      value: "blue",
    },
    {
      label: "Banana",
      value: "banana",
    },
    {
      label: "Pineapple",
      value: "pineapple",
    },
  ]);
  const [size, setSize] = useState([
    {
      label: 22,
      value: 22,
    },
    {
      label: 33,
      value: 33,
    },
    {
      label: "Banana",
      value: "banana",
    },
    {
      label: "Pineapple",
      value: "pineapple",
    },
  ]);

  return (
    <div>
      <select>
        {materials.map((mat) => (
          <option
            value={mat.value}
            onChange={(e) => setMaterials(e.target.value)}
          >
            {mat.label}
          </option>
        ))}
      </select>
      <select>
        {color.map((col) => (
          <option
            value={col.value}
            onChange={(e) => setColor(e.target.value)}
          >
            {col.label}
          </option>
        ))}
      </select>
      <select>
        {size.map((sz) => (
          <option
            value={sz.value}
            onChange={(e) => setSize(e.target.value)}
          >
            {sz.label}
          </option>
        ))}
      </select>
      <h2>hello {materials.label}</h2>
    </div>
  );
};
export default New;
